import React from 'react';

import $ from 'jquery';


class TableList extends React.Component{
    constructor(props) {
      super(props);

      this.TableClick = this.TableClick.bind(this);
    }

    TableClick(e){
        alert('Clicked TableClick Button!');





        e.preventDefault(e);
    }     


    render(){


        return(
            <div>
                <div class="table_column">
                    <div id="table_10" class="rectangle" onClick={this.TableClick}>Table 10</div>
                    <div id="table_9" class="rectangle" onClick={this.TableClick}>Table 9</div>
                    <div id="table_8" class="rectangle" onClick={this.TableClick}>Table 8</div>
                    <div id="table_7" class="rectangle" onClick={this.TableClick}>Table 7</div>
                </div>

                <div class="table_column">
                    <div id="table_6" class="circle">Table 6</div>
                    <div id="table_5" class="circle">Table 5</div>
                    <div id="table_4" class="circle">Table 4</div>
                </div>

                <div class="table_column">
                    <div id="table_3" class="rectangle" onClick={this.TableClick}>Table 3</div>
                    <div id="table_2" class="rectangle" onClick={this.TableClick}>Table 2</div>
                    <div id="table_1" class="rectangle" onClick={this.TableClick}>Table 1</div>
                </div>
            </div>
        );
    }
}

export default TableList;
